import { Link } from "react-router-dom";


function Home(){


    
    return(
        <>
            <ul>
                <li onClick={onClick}><Link to="/todo">Todo</Link></li>
                <li onClick={onClick}><Link to="/">Logout</Link></li>
            </ul>
        </>
    )
}

export default Home;
